(4601, 23, 547, '<html>\n<head>\n	<meta charset="UTF-8">\n	<title>Box Model</title>\n	<link rel="shortcut icon" href="favicon.ico">\n	<link rel="stylesheet" type="text/css" href="main.css">\n     <style type="text/css">\n      .padre {\n          margin: 120px 60px 30.5px 60px;\n          padding: 40px 20px 70px 100px;\n          border: 20px solid #9900FF;\n          border-left: 10px solid #9900FF;\n          border-right: 10px solid #9900FF;\n          /*SOLO PARA QUE SE VEA BONITO*/\n          background-color: #F9CB9C;\n      }\n\n      .hijo {\n\n          border: 2px dashed #38761D;\n          background-color: white;\n\n          /*SOLO PARA QUE SE VEA BONITO*/\n          text-align: center;	\n          line-height: 50px;\n          height: 50px;\n      }\n     </style>\n</head>\n<body>\n	<div class="padre">\n		<div class="hijo">Hola Mundo</div>\n	</div>\n</body>\n</html>', '2016-01-11 09:56:52', '2016-01-11 10:05:51', 20),
(4602, 20, 547, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Display</title>\n	<style>\n      * {\n          margin:0;\n          padding: 0;\n          box-sizing: border-box;\n      }\n      \n      .elementos-inline {\n		color: white;\n	  }\n      \n      .elementos-block {\n          margin:20px 0;\n          text-align: center;\n      }      \n      \n      span {\n          background-color: red;\n      }\n\n      strong {\n          background-color: purple;\n      }\n\n      a {\n          background-color: green;\n      }\n      \n      header, section, .elementos-block div, p, aside { width: 150px; display: inline-block; vertical-align: top; }\n      \n.elementos-block header {\n	background-color: blue;\n}\n\n.elementos-block section {\n	background-color: brown;\n}\n\n.elementos-block div {\n	background-color: #000\n}\n\n\n.elementos-block p {\n	background-color: #ededed;\n}      \n    </style>\n</head>\n<body>\n	<div class="elementos-inline">\n		<span>Elemento Inline 1</span>\n		<strong>Elemento Inline 2</strong>\n		<a href="#">Elemento Inline 3</a>\n	</div>\n\n	<div class="elementos-block">\n		<header>Elemento block 1</header>\n		<section>Elemento block 2</section>\n		<div>Elemento block 3</div>\n		<aside>Elemento block 4</aside>\n		<p>Elemento block 5</p>\n	</div>\n</body>\n</html>', '2016-01-11 10:05:52', '2016-01-11 10:35:47', 20),
(4603, 21, 547, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio Diagnóstico: Floating</title>\n    <style>\n      *{\n          margin: 0;\n          padding:0;\n      }\n\n      .clearfix:after {\n           visibility: hidden;\n           display: block;\n           font-size: 0;\n           content: " ";\n           clear: both;\n           height: 0;\n           }\n      .clearfix { display: inline-block; }\n      * html .clearfix { height: 1%; }\n      .clearfix { display: block; }\n      \n.caja {\n	width: 200px;\n	height: 200px;\n	margin: 0 20px 0 0;\n}\n\n.container { background-color: purple; }\n\n.rojo{ background-color: red }\n\n.amarillo{ background-color: yellow; }\n\n.azul{ background-color: blue; }\n    </style>\n</head>\n<body>\n	<div class="container clearfix">\n		<div class="caja rojo"></div>\n		<div class="caja amarillo"></div>\n		<div class="caja azul"></div>\n	</div>\n</body', '2016-01-11 10:35:48', '2016-01-11 10:48:33', 10),
