(4869, 26, 323, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Condicionales</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n    \n    \n    var nombre=prompt("Hola escribe aquí tu nombre");\n    \n    if("nombre".lenght>=2 ){\n         prompt("Hola gian,ahora dinos tu edad");\n         edad=prompt("Hola escribe aquí tu edad");\n    \n    }else{\n         prompt("No escribiste tu nombre :( Inténtalo de nuevo");\n    }\n    \n    \n    if(edad>18){\n            console.log("Eres mayor de edad!")\n    }else{\n            console.log("Eres una niña")\n    }\n    \n    \n    \n    \n    \n    \n    \n    \n    	});\n    });\n  </script>\n</body>\n</html>', '2016-01-12 17:05:02', '2016-01-13 16:07:24', 40),
