(5929, 21, 240, '<!DOCTYPE html>\n<html lang="en">\n<head> \n	<meta charset="UTF-8">\n	<title>Ejercicio Diagnóstico: Floating</title>\n    <style>\n      *{\n          margin: 0;\n          padding:0;\n      }\n\n      .clearfix:after {\n           visibility: hidden;\n           display: block;\n           font-size: 0;\n           content: " ";\n           clear: both;\n           height: 0;\n           }\n      .clearfix { display: inline-block; }\n      * html .clearfix { height: 1%; }\n      .clearfix { display: block; }\n      \n      /* Inserta tu código CSS aqui */\n      .caja{\n      		height: 100px;\n			width: 100px;\n      }\n      .roja{\n      		background-color:red;\n      }\n       .amarilla{\n      		background-color:yellow;\n      }\n       .azul{\n      		background-color:blue;\n      }\n      .container{\n      		width: 100%;\n      		height: 100%;\n      		background-color: purple;\n      }\n    </style>\n</head>\n<body>\n	<!-- inserta tu codigo aqui -->\n  <div class="container clearfix">\n    <div class="caja roja"></div>\n    <div class="caja amarilla"></div>\n    <div class="caja azul"></div>\n  </div>\n</body', '2016-01-15 21:25:20', '2016-01-18 06:11:08', 10),
