(5945, 25, 240, '<!DOCTYPE html>\n<html lang="en">\n<head> \n	<meta charset="UTF-8">\n	<title>Ejercicio Diagnóstico: Floating</title>\n    <style>\n      *{\n          margin: 0;\n          padding:0;\n      }\n\n      .clearfix:after {\n           visibility: hidden;\n           display: block;\n           font-size: 0;\n           content: " ";\n           clear: both;\n           height: 0;\n           }\n      .clearfix { display: inline-block; }\n      * html .clearfix { height: 1%; }\n      .clearfix { display: block; }\n      \n      /* Inserta tu código CSS aqui */\n      .caja{\n      		height: 100px;\n			width: 100px;\n      		float: right;\n      		margin-right: 20px;\n      }\n      .roja{\n      		background-color:red;\n      }\n       .amarilla{\n      		background-color:yellow;\n      }\n       .azul{\n      		background-color:blue;\n      }\n      .container{\n      		width: 100%;\n      		height: 100%;\n      		background-color: purple;\n      }\n    </style>\n</head>\n<body>\n	<!-- inserta tu codigo aqui -->\n  <div class="container clearfix">\n    <div class="caja roja"></div>\n    <div class="caja amarilla"></div>\n    <div class="caja azul"></div>\n  </div>\n</body', '2016-01-16 00:32:19', '2016-01-18 06:11:08', 10),
(5946, 26, 240, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Condicionales</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n    		/*Inserta tu codigo aqui, cuando quieras ejecutarlo dale click al boton Ejecuta el codigo */\n    		var nombre=prompt("Hola escribe aquí tu nombre");\n    		if(nombre.length>0){\n    			alert("Hola "+nombre+", ahora dinos tu edad");\n    			var edad = prompt("Hola escribe aquí tu edad");\n    		}else{\n    			alert("No escribiste tu nombre :( Inténtalo de nuevo");\n    		}\n    		if(edad>18){\n    			alert("Eres mayor de edad!");\n    		}else{\n    			alert("Eres una niña");\n    		}\n    	});\n    });\n  </script>\n</body>\n</html>', '2016-01-16 00:32:56', '2016-01-18 06:11:08', 50),
(5947, 27, 240, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Repetitivas</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n    		/*Inserta tu codigo aqui, cuando quieras ejecutarlo dale click al boton Ejecuta el codigo */\n    		var counter;\n    		for(counter=0; counter<6 ; counter++){\n                  if(counter==5){\n                   	alert("Boom");\n                  }else{\n                    console.log("Ciclo "+counter);                 \n                  }     \n            }\n    	});\n    });\n  </script>\n</body>\n</html>', '2016-01-16 00:40:07', '2016-01-18 06:11:08', 30),
(5948, 28, 240, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Pelota que</title>\n    <style>\n      body{\n        background: #ccc;\n      }\n\n      .vacaciones-container {\n        margin: 0 auto;\n        max-width: 1020px;\n        width:100%;\n      }\n\n      .vacaciones {\n        display:inline-block;\n        margin: 0 1% 0 0;\n        background-color:rgba(0,130,34, 0.1);\n        padding: 0 4% 10px 1%;\n      }\n\n      .vacaciones h2 {\n        font-size: 1em;\n      }\n\n      span {\n        font-weight: bolder;\n        color: #51075b;\n      }\n    </style>\n</head>\n<body>\n  <button id="run">Ejecutar codigo</button>\n	<div id="vacaciones-container">\n  		<h1>Vacation Packages</h1>\n  		<ul id="vacaciones">\n    		<li class="vacaciones america">\n  				<h2>San Francisco, California</h2>\n     			<span class="details">$700</span>\n    		</li>\n    		<li class="vacaciones america">\n      			<h2>Washington DC, District of Columbia</h2>\n      			<span class="details">$400</span>\n    		</li>\n    		<li class="vacaciones europe">\n      			<h2>London, England</h2>\n      			<span class="details">$1,100</span>\n    		</li>\n    		<li class="vacaciones asia">\n      			<h2>Shanghai, China</h2>\n      			<span class="details">$1,200</span>\n    		</li>\n  		</ul>\n	</div>\n	\n	<script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>\n    <script type=''text/javascript''>\n      	$(document).ready(function(){\n      		$("#run").click(function(e) {\n				/* Inserta tu codigo aqui */\n      			$(".america").css("width","400px");\n      		});\n        });\n    </script>\n</body>\n</html>', '2016-01-16 00:46:54', '2016-01-18 06:11:08', 10),
(5949, 29, 240, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Pelota que Rebota</title>\n	<style>\n      body {\n          background-image: url(''http://bit.ly/UpQgJ6'');\n          background-repeat: no-repeat;\n      }\n\n      div {\n          height: 100px;\n          width: 100px;\n          border-radius: 100%;\n          background-color: #008800;\n          background-image: -webkit-gradient(linear, 0% 0%, 0% 100%, from(#003500), to(#008800));\n          background-image: -webkit-linear-gradient(left, #003500, #008800); \n          background-image:    -moz-linear-gradient(left, #003500, #008800);\n          background-image:     -ms-linear-gradient(left, #003500, #008800);\n          background-image:      -o-linear-gradient(left, #003500, #008800);\n      }\n    </style>\n</head>\n<body>\n	<div></div>\n	\n	<script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>\n    <script src="http://ajax.googleapis.com/ajax/libs/jqueryui/1.9.1/jquery-ui.min.js"></script>\n    <script type=''text/javascript''>\n    	$(document).ready(function(){\n      		$(''div'').click(function(){\n        $(''div'').effect(''bounce'',{times:5}, 800);\n    });\n		});\n    </script>\n</body>\n</html>', '2016-01-16 00:50:34', '2016-01-18 06:11:08', 10),
