(7430, 26, 428, '<!DOCTYPE html>\n<html lang="en">\n<head>\n	<meta charset="UTF-8">\n	<title>Ejercicio: Condicionales</title>\n</head>\n<body>\n  <button id="run">Ejecuta el código</button>\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \n  <script type="text/javascript">\n    $(document).ready(function() {\n    	$("#run").click(function(e) {\n    		e.preventDefault();\n    		/*Inserta tu codigo aqui, cuando quieras ejecutarlo dale click al boton Ejecuta el codigo */\n    		var nombre = prompt("hola escribe tu nombre");\n    		console.log(nombre);\n    		if(nombre != null){\n    			alert("hola " + nombre + " ahora dinos tu edad");\n    			var edad = 0;\n    			edad = prompt("hola escribre aquí tu edad");\n    		}\n    		else if(edad === null){\n    			alert("no escribiste tu nombre, intentalo de nuevo");\n    		}\n    \n    		if(edad >= 18){\n    			alert("eres mayor de edad");\n    		}\n    		else{\n    			alert("eres una niña");\n    		}\n    	});\n    });\n  </script>\n</body>\n</html>', '2016-01-19 15:47:50', '2016-01-19 17:30:09', NULL);
