(1, 'Conoce a tu instructura', 1, '2015-11-09 22:56:45', '2016-02-10 12:42:36', 'video', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(2, 'El editor de texto y el navegador', 1, '2015-11-10 15:07:59', '2016-01-11 18:57:23', 'video', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'Ahora usa el editor de texto', 1, '2015-11-10 15:26:01', '2016-02-10 12:48:03', 'editor', 4, '###INSTRUCCIONES\r\n\r\n 1. En editor de texto, cambia el texto **Esto es un titular** por **Laboratoria**\r\n 2. Luego cambia el texto **Esto es un párrafo** por **En Laboratoria aprendemos a crear páginas web para empezar una carrera en el sector digital**\r\n 3. Al terminar presiona el botón de Guardar y Continuar\r\n\r\nSi has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo.', '', '<html>\r\n  <head></head>\r\n  <body>\r\n    <h1>Esto es un titular</h1>\r\n    <p>Esto es un párrafo</p>\r\n  </body>\r\n</html>', '<html>\r\n  <head></head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos a crear páginas web para empezar una carrera en el sector digital</p>\r\n  </body>\r\n</html>', '¡Excelente!|Ya empezaste tu camino como desarrolladora web. Presiona el botón de continuar para avanzar.', 'O42uKCBXxlw', 10, NULL, 0, 0, 1, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(4, 'Etiquetas', 22, '2015-11-10 15:30:14', '2016-02-10 12:55:36', 'video', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(5, 'Más etiquetas...', 22, '2015-11-10 15:30:37', '2016-02-10 12:55:40', 'video', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(6, 'Has tu primera web con etiquetas', 22, '2015-11-10 15:45:21', '2016-02-10 12:55:47', 'editor', 3, '###INSTRUCCIONES\r\n\r\n 1. En editor de texto, dentro del body crea un titular h1 que diga **Laboratoria**\r\n 2. Debajo del h1 crea un párrafo que diga **En Laboratoria aprendemos\r\n    varios lenguajes para crear páginas web. A continuación presentamos\r\n    una lista de los lenguajes que aprendemos.**\r\n 3. Debajo del párrafo crea un titular h4 que diga **Lenguajes:**\r\n 4. Debajo del titular h4 crea una lista con 3 elementos: el primero con el texto **HTML**, el segundo con el texto **Javascript** y el tercero con el texto **PHP**\r\n 5. Al terminar presiona el botón de Guardar y Continuar\r\n\r\n*Nota importante*: debes escribir los textos idénticos a lo solicitado (incluyendo los signos de puntuación) para que el sistema reconozca tu respuesta correctamente. Si has realizado algunos cambios y deseas empezar desde cero nuevamente, puedes presionar el botón de Empezar de nuevo. ', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body> \r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '¡Muy bien!|Estás rompiéndola. Presiona el botón de continuar para avanzar.', 'tlCnl6QCx9g', 30, NULL, 0, 0, 1, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(7, 'Imágenes', 22, '2015-11-10 15:46:24', '2016-02-10 12:55:53', 'video', 4, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(8, '¿Qué aprendí sobre las Etiquetas?', 22, '2015-11-10 15:48:14', '2016-02-10 12:55:58', 'questions', 5, '', '', '', '', '', '', NULL, 3, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(9, 'Tú página necesita estilos', 23, '2015-11-10 15:48:41', '2016-02-10 12:56:07', 'video', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(10, 'Prueba tu conocimiento: estilos', 23, '2015-11-10 15:52:31', '2016-02-10 12:56:15', 'editor', 2, 'INSTRUCCIONES\r\n\r\n 1. En el editor de texto, cambia el color del párrafo a azul (tip: azul en inglés se escribe **blue**) y su tamaño de letra a 22px\r\n 2. Al terminar presiona el botón de Guardar y Continuar', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p>En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <h1>Laboratoria</h1>\r\n    <p style="color:blue;font-size:22px;">En Laboratoria aprendemos varios lenguajes para crear páginas web. A continuación presentamos una lista de los lenguajes que aprendemos.</p>\r\n    <h4>Lenguajes:</h4>\r\n    <ol>\r\n      <li>HTML</li>\r\n      <li>Javascript</li>\r\n      <li>PHP</li>\r\n    </ol>  \r\n  </body>\r\n</html>', '¡Éxito!|Pareces una profesional. Presiona el botón de continuar para avanzar.', '1pC2S51_GRQ', 20, NULL, 0, 0, 1, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
