(13, 'Prueba tu conocimiento: contenedores', 23, '2015-11-10 15:57:48', '2016-02-10 12:56:34', 'editor', 5, 'INSTRUCCIONES\r\n\r\n 1. En el editor de texto, agrega una caja adicional del mismo ancho y de la misma altura que las demás, pero de color verde (tip: verde en inglés se escribe **green**)\r\n 2. Logra que todos los contenedores estén uno al lado del otro utilizando la propiedad display y el valor inline-block\r\n 3. Al terminar presiona el botón de Guardar y Continuar', '', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style="width:50px;height:50px;background-color:red;"></div>\r\n    <div style="width:50px;height:50px;background-color:blue;"></div>\r\n    <div style="width:50px;height:50px;background-color:yellow;"></div>\r\n  </body>\r\n</html>', '<html>\r\n  <head>\r\n    <title>Laboratoria Curso Básico</title> \r\n  </head>\r\n  <body>\r\n    <div style="width:50px;height:50px;background-color:red;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:blue;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:yellow;display:inline-block;"></div>\r\n    <div style="width:50px;height:50px;background-color:green;display:inline-block;"></div>\r\n  </body>\r\n</html>', '¡Fenomenal!|No pares. Eres una coder natural. Presiona el botón de continuar para avanzar.', 'CExTaFKo9So', 25, NULL, 0, 0, 1, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
