(16, 'Felicitaciones has completado el curso', 23, '2015-11-10 16:14:52', '2016-02-10 12:56:51', 'closer', 8, '', '<div class="close-container">\r\n  <h2 class="text-center">\r\n    Felicitaciones has completado el curso\r\n  </h2>\r\n  <h3 class="text-center">Este ha sido tu primer paso para convertirte en desarrolladora web.</h3>\r\n  <h3 class="text-center">¡Sigue adelante!</h3>\r\n</div>', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', 0, '', NULL, NULL, NULL, NULL),
(17, 'Bienvenida', 2, '2016-01-07 23:03:28', '2016-01-11 09:40:05', 'opener', 1, '', '<div class="container-fluid">\r\n  <div class="page-header">\r\n    <h1>Hola Coder!</h1>\r\n  </div>\r\n  <p>Bienvenida, el día de hoy vamos a realizar una serie de pequeños ejercicios que nos permitirá medir cuanto has aprendido con los cursos de codecademy.</p>\r\n  <p>Con estos ejercicios podremos ajustar mejor las futuras clases y la velocidad con que debe ir el curso.</p>\r\n  <p>Cada unidad constan de una serie de ejercicios individuales que debes codear en el editor y al final de la unidad un pequeño cuestionario para validar tus conocimientos.</p>\r\n  <p>Tranquila, recuerda que estos ejercicios más que tener una nota nos sirven para poder ajustar las clases a ustedes, así que muy buena suerte y dale con todo coder!</p>\r\n  <a href="/mycourses/2/u/2/p/18" class="btn btn-primary">Lista, vamos con todo!!</a>\r\n  <br>\r\n</div>', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(18, 'Creando mi Perfil - Estructurando mi HTML', 2, '2016-01-07 23:24:40', '2016-01-08 17:05:01', 'editor', 2, 'INSTRUCCIONES\r\n\r\nBienvenida, este ejercicio tiene varios pasos pero iremos poco a poco hasta tener nuestra primera página web. Empecemos con las siguientes instrucciones:\r\n\r\n 1. Coloca un título (h1) en la página con tu nombre\r\n 2. Busca una imagen en Google que te guste y crea el tag correspondiente debajo del título .\r\n 3. Ahora que ya tienes la imagen has que tenga un ancho y un alto específico\r\n\r\nMuy bien, ahora sigue con la segunda parte del ejercicio:\r\n\r\n 1. Crea una tabla de 3x2 (3 filas por 2 columnas)\r\n 2. En la primera columna pondremos los títulos de las secciones (Biografía, Hobbies, Sueños) respectivamente. No te olvides que tienen que ir en negrita\r\n 3. En la otra columna deben ir los contenidos de la secciones\r\n   3.1. Biografía => Texto simple\r\n   3.2. Hobbies => Una lista desordenada de 3 hobbies, uno de ellos debe tener otra lista de 3 elementos\r\n   3.3. Sueños => Una lista ordenada de 3 elementos\r\n\r\nSi has seguido todos los pasos entonces el código debería verse de la siguiente forma\r\n\r\n![Mi perfil - sin CSS][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/diagnostico-sin-css.png', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Diagnóstico Codecademy</title>\r\n</head>\r\n<body>\r\n  <!-- Inserta tu código aquí -->\r\n</body>\r\n</html>', '<!DOCTYPEhtml><htmllang="en"><head><metacharset="UTF-8"><title>(.*?)<\\/title><\\/head><body><h1>(.*?)<\\/h1><img(src="(.*?)"|width="(\\d*?)"|height="(\\d*?)")(src="(.*?)"|width="(\\d*?)"|height="(\\d*?)")(src="(.*?)"|width="(\\d*?)"|height="(\\d*?)")><table><tr><td><b>(.*?)<\\/b><\\/td><td>(.*?)<\\/td><\\/tr><tr><td><b>(.*?)<\\/b><\\/td><td><ul>((<li>(.*?)<\\/li><li>(.*?)<\\/li><ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul>)|(<li>(.*?)<\\/li><ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul><li>(.*?)<\\/li>)|(<ul><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ul><li>(.*?)<\\/li><li>(.*?)<\\/li>))<\\/ul><\\/td><\\/tr><tr><td><b>(.*?)<\\/b><\\/td><td><ol><li>(.*?)<\\/li><li>(.*?)<\\/li><li>(.*?)<\\/li><\\/ol><\\/td><\\/tr><\\/table><\\/body><\\/html>', 'Genial, sigue adelante!', '', 30, NULL, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(19, 'Creando mi Perfil - Agregando CSS', 2, '2016-01-08 17:59:47', '2016-01-11 09:48:44', 'editor', 3, 'INSTRUCCIONES\r\n\r\nAhora que ya tenemos la estructura HTML, nos toca ponerles algo de color y forma a nuestra estructura mediante CSS. \r\n\r\nSigue las instrucciones:\r\n\r\n 1. Antes de empezar agrega el tag <style></style> **al final del head**, dentro de este tag pondremos todo el CSS de nuestra página.\r\n 2. Primero cambia el fondo de la página por un fondo de tipo imagen (**tip: background del body**), puedes utilizar la imagen de la siguiente ruta: [https://dl.dropboxusercontent.com/u/1621947/fondo.png][1]\r\n 3. Ahora has que la imagen que agregaste de google tenga un borde redondeado de 30 pixels\r\n 4. Luego separa la tabla de la parte superior unos 30 pixeles  y de la parte inferior unos 40 pixeles además has que tenga un borde de 2 pixeles de color gris y un padding de 15px\r\n\r\nSi has seguido todos los pasos entonces el código debería verse de la siguiente forma\r\n\r\n![Estado final de la página][2]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/fondo.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/diagnostico.png', '', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n<meta charset="UTF-8">\r\n<title>(.*?)<\\/title>\r\n<style>\r\nbody {\r\nbackground-image: url\\("https:\\/\\/dl.dropboxusercontent.com\\/u\\/1621947\\/fondo.png"\\);\r\n}\r\nimg {\r\nborder-radius: 30px;\r\n}\r\ntable {\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n(margin-top: 30px;|margin-bottom: 40px;|border: 2px solid gray;|padding: 15px;)\r\n}\r\n<\\/style>\r\n<\\/head>\r\n<body>\r\n<h1>(.*?)<\\/h1>\r\n<img (src="(.*?)"|width="(\\d*?)"|height="(\\d*?)") (src="(.*?)"|width="(\\d*?)"|height="(\\d*?)") (src="(.*?)"|width="(\\d*?)"|height="(\\d*?)")>\r\n<table>\r\n<tr>\r\n<td><b>(.*?)<\\/b><\\/td>\r\n<td>\r\n(.*?)\r\n<\\/td>\r\n<\\/tr>\r\n<tr>\r\n<td><b>(.*?)<\\/b><\\/td>\r\n<td>\r\n<ul>\r\n((<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<ul>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<\\/ul>)|(<li>(.*?)<\\/li>\r\n<ul>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<\\/ul>\r\n<li>(.*?)<\\/li>\r\n)|(<ul>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<\\/ul>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n))\r\n<\\/ul>\r\n<\\/td>\r\n<\\/tr>\r\n<tr>\r\n<td><b>(.*?)<\\/b><\\/td>\r\n<td>\r\n<ol>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<li>(.*?)<\\/li>\r\n<\\/ol>\r\n<\\/td>\r\n<\\/tr>\r\n<\\/table>\r\n<\\/body>\r\n<\\/html>', 'Excelente, has creado tu primera página web.', '', 30, NULL, 0, 1, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(20, 'Alineando elementos con Displays', 2, '2016-01-08 20:57:38', '2016-01-11 10:35:41', 'editor', 5, 'INSTRUCCIONES\r\n\r\nLa propiedad display nos permite definir el tipo de caja (**una al costado de la otra o 1 por línea**) que se va a mostrar en el HTML, en su forma más sencilla tenemos (**inline, inline-block, block**). \r\n\r\nTodos los elementos por defecto tienen un display el cual luego puede ser cambiado en el CSS. \r\n\r\nDicho esto en el ejercicio se pide lo siguiente:\r\n\r\n 1. Crea 3 bloques de colores (cualquier color de fondo) usando 3 tags que tengan la propiedad inline por defecto\r\n 2. Crea 5 bloques de colores (cualquier color de fondo) usando 5 tags que tengan la propiedad block por defecto\r\n 3. Ahora que ya tienes todos los elementos block definidos, cambia la propiedad de estos para que se muestren como inline block y que tenga un ancho de 150px', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Display</title>\r\n	<style>\r\n      * {\r\n          margin:0;\r\n          padding: 0;\r\n          box-sizing: border-box;\r\n      }\r\n      \r\n      .elementos-inline {\r\n		color: white;\r\n	  }\r\n      \r\n      .elementos-block {\r\n          margin:20px 0;\r\n          text-align: center;\r\n      }      \r\n      \r\n      /* Inserta aqui tus estilos */\r\n    </style>\r\n</head>\r\n<body>\r\n	<div class="elementos-inline">\r\n		<!-- Inserta tu código para elementos inline aqui-->\r\n	</div>\r\n\r\n	<div class="elementos-block">\r\n		<!-- Inserta tu código para elementos block aqui-->\r\n	</div>\r\n</body>\r\n</html>', '', 'Muy bien! sigue así', '', 20, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(21, 'Alineando elementos con Floatings - Parte 1', 2, '2016-01-08 21:32:35', '2016-01-11 10:43:31', 'editor', 6, 'INSTRUCCIONES\r\n\r\nYa hemos visto como usar Display para alinear alguno de los elementos, ahora utilizaremos la propiedad float para lo mismo, si no te acuerdas cómo funciona la propiedad floating puedes investigar en google un poco para que refrescar los conocimientos.\r\n\r\nPara el siguiente ejercicio se pide que armes la siguiente estructura que luego modificaremos usando la propiedad float.\r\n\r\n 1. Crea un div que tenga dos clases "container clearfix"\r\n 2. Dentro de ese div crea otros 3 divs que tenga la clase caja\r\n 3. A cada caja asignarle un color agregando la clase rojo, amarillo o azul respectivamente a cada elemento. Por ejemplo class="caja rojo". **Tip: Recuerda el espacio**\r\n\r\nSi todo salió bien la clase debería quedar así:\r\n\r\n![Floating 01][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/floating-01.png', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio Diagnóstico: Floating</title>\r\n    <style>\r\n      *{\r\n          margin: 0;\r\n          padding:0;\r\n      }\r\n\r\n      .clearfix:after {\r\n           visibility: hidden;\r\n           display: block;\r\n           font-size: 0;\r\n           content: " ";\r\n           clear: both;\r\n           height: 0;\r\n           }\r\n      .clearfix { display: inline-block; }\r\n      * html .clearfix { height: 1%; }\r\n      .clearfix { display: block; }\r\n      \r\n      /* Inserta tu código CSS aqui */\r\n    </style>\r\n</head>\r\n<body>\r\n	<!-- inserta tu codigo aqui -->\r\n</body', '', 'Genial, sigue adelante!', '', 10, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(23, 'Modelo de Caja', 2, '2016-01-08 21:53:17', '2016-01-11 10:04:20', 'editor', 4, 'INSTRUCCIONES:\r\n\r\nReplica la siguiente imagen usando lo que has aprendido sobre el concepto del modelo de la caja.\r\n\r\nSigue los siguientes pasos:\r\n\r\n 1. Lo primero que tienes que hacer es crear dos <div> uno dentro del otro, y darles una clase a cada uno (el nombre de las clases puede ser "padre" y para el div interno "hijo" respectivamente).\r\n 2. Para darle estilos a tu HTML tendrás que hacerlo en  el espacio de la etiqueta <style> de la misma manera que lo hacías en el editor de CSS del Codecademy. \r\n 3. Usa margin (para centrar la caja).\r\n 4. Usa padding (para darle relleno  a la caja).\r\n 5. Usa border (recuerda que "dashed" es para hacer tu borde descontinuo y "solid " es para hacer un borde continuo).\r\n\r\n![Modelo de caja ][1]\r\n\r\n[1]: https://dl.dropboxusercontent.com/u/1621947/box-model.png ', '', '<html>\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Box Model</title>\r\n	<link rel="shortcut icon" href="favicon.ico">\r\n	<link rel="stylesheet" type="text/css" href="main.css">\r\n     <style type="text/css">\r\n     	/*escribe aqui los estilos de la misma manera que lo hacias en el CSS del editor del Codecademy*/\r\n     </style>\r\n</head>\r\n<body>\r\n	<!--escribe aqui tu codigo -->	\r\n</body>\r\n</html>', '<html>\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Box Model</title>\r\n	<link rel="shortcut icon" href="favicon.ico">\r\n	<link rel="stylesheet" type="text/css" href="main.css">\r\n      <style type="text/css">\r\n        .padre { \r\n        	margin: 120px 60px 30.5px 60px;\r\n			padding: 40px 20px 70px 100px;\r\n			border: 20px solid #9900FF;\r\n			border-left: 10px solid #9900FF;\r\n			border-right: 10px solid #9900FF;\r\n			/*SOLO PARA QUE SE VEA BONITO*/\r\n			background-color: #F9CB9C;\r\n			}\r\n\r\n		.hijo {\r\n            border: 2px dashed #38761D;\r\n            background-color: white;\r\n\r\n            /*SOLO PARA QUE SE VEA BONITO*/\r\n            text-align: center;	\r\n            line-height: 50px;\r\n            height: 50px;\r\n       		}\r\n      </style>\r\n</head>\r\n<body>\r\n	<div class="padre">\r\n		<div class="hijo">Hola Mundo</div>\r\n	</div>		\r\n</body>\r\n</html>', 'Muy bien; Has aprendido', '', 20, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(24, 'Alineando elementos con Floatings - Parte 2', 2, '2016-01-08 22:25:43', '2016-01-08 22:45:23', 'editor', 7, 'INSTRUCCIONES\r\n\r\nAhora que ya tenemos la estructura de nuestro ejercicio definido hagamos el siguiente cambio:\r\n\r\n 1. Hacer flotar los elementos a la izquierda\r\n\r\n![enter image description here][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/floating-02.png', '', '', '', 'Sigue adelante', '', 10, NULL, 0, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 'Alineando elementos con Floatings - Parte 3', 2, '2016-01-08 22:43:46', '2016-01-08 22:43:46', 'editor', 8, 'INSTRUCCIONES\r\n\r\n 1. Ahora hagamos que flote a la derecha debe quedar asi:\r\n\r\n![Floating-03][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/floating-03.png', '', '', '', 'Genial, sigue adelante!', '', 10, NULL, 0, 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Condicionales', 3, '2016-01-08 23:14:08', '2016-01-11 11:23:45', 'editor', 1, 'INSTRUCCIONES:\r\n\r\nContinuando con lo aprendido en el Pre-Trabajo de Javascript, ahora crearemos ventanas emergentes que nos permitirán ingresar y mostrar información \r\n\r\n 1. Al igual que con el CSS vamos a tener que poner nuestro código dentro de la etiqueta <script>\r\n 2. Crea  una variable *nombre*  y dale un  *prompt*  "Hola escribe aquí tu nombre".\r\n 3. Crea una sentencia if que te muestre un  *alert* que diga por ejemplo "Hola gian, ahora dinos tu edad" .\r\n 4. Dentro de tu sentencia if crea una  variable y dale un  *prompt* "Hola escribe aquí  tu edad". y  si no cumple con lo anterior mostrar "No escribiste tu nombre :( Inténtalo de nuevo"\r\n 5. Crea otra sentencia if cuando  *edad*  sea mayor a 18  y mostrar "Eres mayor de edad!" de lo contrario "Eres una niña".\r\n', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Condicionales</title>\r\n</head>\r\n<body>\r\n  <button id="run">Ejecuta el código</button>\r\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \r\n  <script type="text/javascript">\r\n    $(document).ready(function() {\r\n    	$("#run").click(function(e) {\r\n    		e.preventDefault();\r\n    		/*Inserta tu codigo aqui, cuando quieras ejecutarlo dale click al boton Ejecuta el codigo */\r\n    	});\r\n    });\r\n  </script>\r\n</body>\r\n</html>', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Condicionales</title>\r\n</head>\r\n<body>\r\n	\r\n\r\n	<script type="text/javascript">\r\n		var nombre = prompt("Hola escribe aquí tu nombre");\r\n\r\n	if ( nombre != null ) {\r\n		alert("Hola " + nombre + "ahora dinos tu edad" );\r\n\r\n		var edad = prompt("Hola, escribe aquí tu edad");\r\n		}\r\n		else {\r\n			prompt("No escribiste tu nombre :( Inténtalo de nuevo");\r\n		}\r\n\r\n		if ( edad > 18 ) {\r\n			alert("Eres mayor de edad!");\r\n		}\r\n		else {\r\n			alert("Eres una niña!");\r\n		}\r\n\r\n	</script>\r\n</body>\r\n</html>', 'excelente, lo hiciste bien ! ', '', 50, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Repetitivas', 3, '2016-01-08 23:43:08', '2016-01-11 11:36:12', 'editor', 2, 'INSTRUCCIONES:\r\n\r\nPara este ejercicio vamos a crear un robot que contará hasta 5 y una vez que termine explotará.\r\n\r\n 1. Poner todo el código dentro de la etiqueta <script>\r\n 2. Empieza por crear una  variable *counter*\r\n 3. Luego crea un ciclo for que use la variable counter y que vaya de 0 a 5\r\n 4. En cada ciclo imprime en que ciclo te encuentras\r\n 5..Dentro de tu ciclo crea una sentencia if que verifique si counter es igual a 5 y si es así dispare un alert con la palabra "Boom"\r\n 6. Listo! ', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Repetitivas</title>\r\n</head>\r\n<body>\r\n  <button id="run">Ejecuta el código</button>\r\n  <script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>      \r\n  <script type="text/javascript">\r\n    $(document).ready(function() {\r\n    	$("#run").click(function(e) {\r\n    		e.preventDefault();\r\n    		/*Inserta tu codigo aqui, cuando quieras ejecutarlo dale click al boton Ejecuta el codigo */\r\n    	});\r\n    });\r\n  </script>\r\n</body>\r\n</html>', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Repetitivas</title>\r\n</head>\r\n<body>\r\n	\r\n\r\n	<script type="text/javascript">\r\n		var counter;\r\n\r\n		for (counter = 0; counter <= 5; counter++) { \r\n  			console.log(counter);\r\n  			if (counter == 5) {\r\n			alert(''BOOOM'');\r\n			}\r\n		}\r\n\r\n		\r\n\r\n	</script>\r\n</body>\r\n</html>', 'excelente, lo hiciste bien ! ', '', 30, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'Agranda un elemento HTML', 4, '2016-01-09 00:05:36', '2016-01-11 12:00:10', 'editor', 1, 'INSTRUCCIONES:\r\n\r\nContinuando con lo aprendido en el Pre-Trabajo ahora cambiaremos el tamaño de un elemento HTML con jQuery utilizando la propiedad width\r\n\r\n 1. Selecciona los elementos que tengan la clase américa.\r\n 2. Ahora cambia su tamaño a 400px\r\n\r\nHas las modificaciones donde dice <!-- Inserta tu codigo aqui-->\r\n\r\n', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Pelota que</title>\r\n    <style>\r\n      body{\r\n        background: #ccc;\r\n      }\r\n\r\n      .vacaciones-container {\r\n        margin: 0 auto;\r\n        max-width: 1020px;\r\n        width:100%;\r\n      }\r\n\r\n      .vacaciones {\r\n        display:inline-block;\r\n        margin: 0 1% 0 0;\r\n        background-color:rgba(0,130,34, 0.1);\r\n        padding: 0 4% 10px 1%;\r\n      }\r\n\r\n      .vacaciones h2 {\r\n        font-size: 1em;\r\n      }\r\n\r\n      span {\r\n        font-weight: bolder;\r\n        color: #51075b;\r\n      }\r\n    </style>\r\n</head>\r\n<body>\r\n  <button id="run">Ejecutar codigo</button>\r\n	<div id="vacaciones-container">\r\n  		<h1>Vacation Packages</h1>\r\n  		<ul id="vacaciones">\r\n    		<li class="vacaciones america">\r\n  				<h2>San Francisco, California</h2>\r\n     			<span class="details">$700</span>\r\n    		</li>\r\n    		<li class="vacaciones america">\r\n      			<h2>Washington DC, District of Columbia</h2>\r\n      			<span class="details">$400</span>\r\n    		</li>\r\n    		<li class="vacaciones europe">\r\n      			<h2>London, England</h2>\r\n      			<span class="details">$1,100</span>\r\n    		</li>\r\n    		<li class="vacaciones asia">\r\n      			<h2>Shanghai, China</h2>\r\n      			<span class="details">$1,200</span>\r\n    		</li>\r\n  		</ul>\r\n	</div>\r\n	\r\n	<script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>\r\n    <script type=''text/javascript''>\r\n      	$(document).ready(function(){\r\n      		$("#run").click(function(e) {\r\n				/* Inserta tu codigo aqui */      \r\n      		});\r\n        });\r\n    </script>\r\n</body>\r\n</html>', '', 'Genial, sigue adelante!', '', 10, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'Pelota que rebota', 4, '2016-01-09 00:19:07', '2016-01-11 12:06:57', 'editor', 2, 'INSTRUCCIONES\r\n\r\nPara este ejercicio haremos que una pelota rebote cuando le hagamos click para eso tenemos que usar la función de animate de jQuery.\r\nEscribe tu código para animar la pelota cuando le das click donde dice /* Escribe tu código aqui */\r\n', '', '<!DOCTYPE html>\r\n<html lang="en">\r\n<head>\r\n	<meta charset="UTF-8">\r\n	<title>Ejercicio: Pelota que Rebota</title>\r\n	<style>\r\n      body {\r\n          background-image: url(''http://bit.ly/UpQgJ6'');\r\n          background-repeat: no-repeat;\r\n      }\r\n\r\n      div {\r\n          height: 100px;\r\n          width: 100px;\r\n          border-radius: 100%;\r\n          background-color: #008800;\r\n          background-image: -webkit-gradient(linear, 0% 0%, 0% 100%, from(#003500), to(#008800));\r\n          background-image: -webkit-linear-gradient(left, #003500, #008800); \r\n          background-image:    -moz-linear-gradient(left, #003500, #008800);\r\n          background-image:     -ms-linear-gradient(left, #003500, #008800);\r\n          background-image:      -o-linear-gradient(left, #003500, #008800);\r\n      }\r\n    </style>\r\n</head>\r\n<body>\r\n	<div></div>\r\n	\r\n	<script type="text/javascript" src="http://code.jquery.com/jquery-2.1.4.min.js"></script>\r\n    <script src="http://ajax.googleapis.com/ajax/libs/jqueryui/1.9.1/jquery-ui.min.js"></script>\r\n    <script type=''text/javascript''>\r\n    	$(document).ready(function(){\r\n		});\r\n    </script>\r\n</body>\r\n</html>', '', 'Genial, sigue adelante!', '', 10, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
