(36, 'Ejercicio: Conociendo HTML', 7, '2016-01-12 18:30:27', '2016-02-05 16:14:24', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Conociendo_HTML.zip', 'application/x-zip-compressed', 1136, '2016-01-12 18:30:27', 'INSTRUCCIONES (Antes de empezar)\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Conociendo HTML.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Conociendo HTML).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Abre el file index.html y realiza las siguiente modificaciones.\r\n\r\nINSTRUCCIONES DEL EJERCICIO\r\n\r\nCrea una página web que se vea cómo la siguiente imagen\r\n\r\n![Conociendo html][1]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/conociendo-html.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 144400, '2016-02-05 16:14:24'),
