(56, 'Ejercicio: Positioning', 10, '2016-01-16 17:57:28', '2016-02-05 18:26:48', 'exercise', 7, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'flow.zip', 'application/x-zip-compressed', 314, '2016-01-16 17:57:28', 'INSTRUCCIONES (Previas al ejercicio):\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (En caso ya exista no realizar este paso)\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Positioning.\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guardalo en la carpeta creada (Positioning).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n\r\n**Parte 1**\r\n\r\n![Positioning 1][1]\r\n\r\n**Parte 2**\r\n\r\nCambia el “position a relative” a todos los contenedores:\r\n\r\n - ¿Qué cambió? \r\n - Tip: ahora puedes mover este elemento usando top, left,right, bottom\r\n - Experimenta\r\n\r\n**Parte 3**\r\n\r\nAhora logra que se vea así:\r\n\r\n![Positioning 2][2]\r\n\r\n**Parte 4**\r\n\r\nAhora logra que se vea así, pero únicamente modificando el HTML (Tip: explora meter el contenedor azul dentro del rojo)\r\n\r\n![Positioning 3][3]\r\n\r\n**Parte 5**\r\n\r\nAhora vamos a explorar la posición “Absolute” para lograr que se vea así (Tip: debes ajustar el HTML y el CSS)\r\n\r\n![Positioning 4][4]\r\n\r\n**Parte 6**\r\n\r\nLogra que se vea así utilizando la posición absoluta para el azul\r\n\r\n![Positioning 5][5]\r\n\r\n\r\n  [1]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning.png\r\n  [2]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning1.png\r\n  [3]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning2.png\r\n  [4]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning4.png\r\n  [5]: https://dl.dropboxusercontent.com/u/1621947/laboratoria/positioning5.png', 1, '', 'Solución.zip', 'application/x-zip-compressed', 4213, '2016-02-05 18:26:48'),
