(76, 'Ejercicio: Descubriendo los breakpoints', 12, '2016-01-19 23:38:06', '2016-01-24 18:20:20', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'colores.zip', 'application/x-zip-compressed', 515, '2016-01-24 17:50:10', 'INSTRUCCIONES (Previas al ejercicio)\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria (Si es que ya la has creado no es necesario repetir el proceso).\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Viendo cajas\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/) da (Viendo Cajas).\r\n\r\nSeguir las siguientes instrucciones para el ejercicio:\r\n\r\n 1. Insertar una imagen centrada y que se mantenga centrada y ajustada cuando se haga responsive\r\n 2. Utilizar los siguientes breakpoints y cambiar el color de fondo por cada rango de breakpoints\r\n\r\nBreakpoints: \r\n\r\n320px - 375px; GREEN\r\n\r\n376px - 667px; YELLOW\r\n\r\n667px - 1024px; RED\r\n\r\n1024px - 1600px; BLUE\r\n', NULL, NULL, NULL, NULL, NULL, NULL),
