(89, 'Ejercicio: Estructurar un proyecto con SASS - LoveBlog Theme', 14, '2016-01-26 21:28:30', '2016-02-04 15:54:23', 'exercise', 6, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'LoveBlog-Theme.zip', 'application/zip', 2259771, '2016-02-04 15:54:23', 'INSTRUCCIONES (Previas al ejercicio)\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada LoveBlog Theme\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (LoveBlog Theme).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. En la carpeta docs encontrarás 5 pantallas que debes replicar y estructurar con SASS de acuerdo a lo que se haya visto en clase \r\n 6. Ya tienes el **index.html** estructurado para que puedas ir replicando las demás pantallas de manera consistente.\r\n\r\n', 0, '', NULL, NULL, NULL, NULL),
