(91, 'Ejercicio: Arrancando con Jade*', 14, '2016-01-26 22:15:52', '2016-02-08 20:56:47', 'exercise', 8, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Future-Imperfect.zip', 'application/zip', 816892, '2016-02-08 20:56:47', 'INSTRUCCIONES (Previas al ejercicio)\r\n\r\n 1. Crear un carpeta en tus documentos que se llame laboratoria.\r\n 2. Dentro de la carpeta laboratoria, crea otra carpeta llamada Future Imperfect\r\n 3. Descarga el zip que se encuentra en la sección de Descarga y guárdalo en la carpeta creada (Future Imperfect).\r\n 4. Extrae el contenido del ZIP en la misma ruta (http://7zip-es.updatestar.com/)\r\n 5. Instalar Jade de acuerdo a los pasos explicados en clase y los slides.\r\n 6. Crea tu archivo **index.jade**, que usarás para armar el landing, dentro de la carpeta **jade**\r\n 7. Investigar en la Documentación de Jade o en donde encuentres información sobre lo siguiente:\r\n\r\nComo hacer para que ese **index.jade** genere un **index.html** para el navegador y que ese **index.html** se encuentre en la raíz del directorio de tu proyecto ( pre-compilación jade )\r\nComo hacer para que Jade siempre esté pendiente de los cambios que se hagan en el **index.jade** y se actualice automáticamente en el **index.html** ( jade watch )\r\n\r\n 8. Comienza a crear el landing que ves a continuación usando Jade y Sass.', 0, '', NULL, NULL, NULL, NULL),
