(110, 'Explorando Scratch', 15, '2016-02-01 20:46:12', '2016-02-02 00:13:32', 'slides', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, 'https://docs.google.com/presentation/d/1SFEjoGSP8KzYYaXSnwxxBkkstGxOdceivQVa4gkQ-jI/embed?start=false&loop=false&delayms=6000', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(111, 'Ejercicio: Bailando', 15, '2016-02-01 22:24:15', '2016-02-01 22:51:59', 'exercise', 2, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #1:BAILANDO\r\n---------------------\r\n\r\nAbre la siguiente URL:\r\n\r\nhttps://scratch.mit.edu/projects/editor/?tip_bar=getStarted\r\n\r\nSigue las siguientes instrucciones:\r\n\r\n 1. Mueve el gato 10 pasos hacia adelante \r\n 2. Haz que suene el tambor cuando el gato se mueve hacia adelante \r\n 3. Haz que el gato inmediatamente retroceda 10 pasos (tip: usa el -10) \r\n 4. Haz que suene el platillo cuando se mueve hacia atrás \r\n 5. Logra que todo se repita 10 veces \r\n 6. Logra que todo inicie cuando haces clic en la bandera \r\n 7. Cambia el escenario \r\n 8. Cambia el color del gato cada vez que presiones la tecla espacio \r\n 9. Haz que antes de empezar a bailar el gato diga: ”Mira cómo bailo” (tip: busca en apariencia)\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL),
(112, 'Ejercicio: Pong', 15, '2016-02-01 22:38:55', '2016-02-01 22:51:28', 'exercise', 4, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio # 2: Pong\r\n-------------------\r\n**PARA CREAR LA PELOTA**\r\n 1. Elimina el GATO y crea un objeto que sea una PELOTA\r\n 2. Mueve la pelota indefinidamente (tip: botón “por siempre” en control) en el escenario rebotando en las paredes (tip: botón de “rebotar si toca un borde” en movimientos)\r\n 3. Haz que la pelota empiece desde x: 0 , y: 160 (tip: en movimientos hay un botón de “ir a x: _ y:_”)\r\n 4. Haz que la pelota baje en un ángulo \r\n\r\n\r\n**PARA CREAR LA PALETA**\r\n\r\n1. Crea un objeto que sea una PALETA (paddle)\r\n2. Haz que la paleta inicie el juego (al hacer clic en la bandera verde) en la posición x: 0 y: -120\r\n3. Haz que la paleta se mueva 30 pasos a la derecha cuando haces clic en la flecha de la derecha \r\n4. Haz que la paleta se mueva 30 pasos a la izquierda cuando haces clic en la flecha de la izquierda \r\n\r\n\r\n**INTERACCION**\r\n\r\n 1. Haz que la pelota rebote al tocar la paleta y que suene un pop (tip: usa una combinación del botón “tocando a:” en sensores, más el condicional “si, entonces” y el “por siempre”)\r\n 2. Haz que el juego se detenga si la pelota pasa por debajo de la paleta \r\n 3. Cambia el escenario por algo divertido\r\n\r\n\r\n', NULL, NULL, NULL, NULL, NULL, NULL),
(113, 'Fundamentos de Scratch', 15, '2016-02-01 22:45:44', '2016-02-02 00:19:57', 'slides', 3, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, 'https://docs.google.com/presentation/d/180o-kTf73gYy2vytwmAxNHl1nBWfReSWe37h2K0flps/embed?start=false&loop=false&delayms=6000', NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL),
(114, 'Ejercicio: Monkey', 15, '2016-02-01 22:55:15', '2016-02-02 23:58:51', 'exercise', 5, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', NULL, NULL, NULL, NULL, 'Ejercicio #3: MONKEY\r\n--------------------\r\n\r\nEl ejercicio consiste en poner un escenario en el que  un jugador pueda desplazar un changuito tanto a la derecha como la izquierda; del cielo caen bananas y bichos. \r\nSi el mono toca una banana, el jugador gana **+X** puntos, pero  si toca el bicho pierde  **-Y** puntos.\r\n\r\nSe pueden agregar tantas características como se desee\r\n\r\nEjemplo del juego: https://scratch.mit.edu/projects/67394790/\r\n\r\n  [1]: https://scratch.mit.edu/projects/67394790/', NULL, NULL, NULL, NULL, NULL, NULL),
