(123, 'Hackathon: Proyecto Sentient', 21, '2016-02-04 12:53:02', '2016-02-04 12:53:02', 'exercise', 1, '', '', '', '', '', '', NULL, NULL, 0, 0, 0, 0, '', 'Sentient.zip', 'application/x-zip-compressed', 6864217, '2016-02-04 12:53:02', '**INSTRUCCIONES**\r\n\r\nEl webshop de laboratoria nos ha encargado realizar un proyecto para un cliente real, el proyecto consiste de un landing page de 3 hojas que muestra la información básica del cliente y de su compañia. \r\n\r\nNosotros como laboratoria educación hemos aceptado el reto y vamos realizar este proyecto en grupos de 2 persona para proponer la mejor solución \r\n\r\n 1. Formar grupos de 2 y comunicarlo a los evaluadores para quede el registro de quien está trabajando con quien. \r\n 2. Descargar el archivo adjunto, tomarse un tiempo para entender lo que se necesite (hacer las consultas del caso necesario para entender todas las aristas del problema)\r\n 3. Una de las integrantes crea un repositorio en github e invita a su compañera a colaborar (los colaboradores se agregan en settings)\r\n 4. La integrante que creo el repositorio sube la primera versión (lo que se entregó en el zip) para que su compañera pueda hacer git pull (descargar los cambios)\r\n 5. Ahora sí a desarrollar, dividan bien el trabajo y midan sus tiempos\r\n 6. Una vez terminado el proyecto se hará una presentación frente a un jurado que representará al cliente y que medirá que tan bien le venden el website\r\n\r\n\r\n ', 0, '', NULL, NULL, NULL, NULL);
